const Card = (data) => {

    console.log(data.title);

    return (
        <div className="card">
            <img src={data.image} />
            <div className="card-details">
                <h2 className="gold">{data.title}</h2>
                <h4 className="beige">{data.artist}</h4>
                <p className="tan">reviewed by {data.author}</p>
            </div>
        </div>
    );
}

export default Card;
